import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './Components/Navbar/Navbar';
import Home from './Pages/Home/Home';
import MyApplication from './Pages/My-Application/MyApps';
import Shifts from './pages/Shifts';
import InternetStatus from './pages/InternetStatus';
import Chat from './pages/Chat';
import Login from './pages/Login';
import Signup from './pages/Signup';

function App() {
    const [isAuthenticated, setIsAuthenticated] = useState(false);
    const [username, setUsername] = useState(''); // Set username on login

    const handleLogin = (user) => {
        setIsAuthenticated(true);
        setUsername(user);
    };

    const handleLogout = () => {
        setIsAuthenticated(false);
        setUsername('');
    };

    return (
        <Router>
            <Navbar isAuthenticated={isAuthenticated} username={username} onLogout={handleLogout} />
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/my-application" element={<MyApplication />} />
                <Route path="/shifts" element={<Shifts />} />
                <Route path="/internet-status" element={<InternetStatus />} />
                <Route path="/chat" element={<Chat />} />
                <Route path="/login" element={<Login onLogin={handleLogin} />} />
                <Route path="/signup" element={<Signup />} />
            </Routes>
        </Router>
    );
}

export default App;
